script: |
  super -f text -I q6354.spq | sort > q6354.out

inputs:
  - name: q6354.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE ( - + col0 NOT BETWEEN + - col2 * - + col2 AND col0 + - + col0 + + col1 + + ( + - col0 ) );
  - name: tab1

outputs:
  - name: q6354.out
    data: |
      51	14	96
      85	5	59
      91	47	68
